script: |
  super -f tsv -I q8326.sql | sort > q8326.out

vector: true

inputs:
  - name: q8326.sql
    data: |
      SELECT ALL tab2.col2 * + tab2.col2 FROM tab2 GROUP BY col2 HAVING ( + tab2.col2 ) IS NOT NULL OR NULL IS NOT NULL;
  - name: tab2

outputs:
  - name: q8326.out
    data: |
      3364
      6241
      7569
